import api from './api'

class FonecedoresService {
  async getAllFonecedores() {
    const response = await api.get('/api/fornecedores/')
    return response.data
  }
  async saveFonecedores(fornecedores) {
    const response = await api.post('/api/fornecedores/', fornecedores)
    return response.data
  }
  async deleteFonecedores(fornecedores) {
    const response = await api.delete(`/api/fornecedores/${fornecedores.id}/`)
    return response.data
  }
}

export default new FonecedoresService()
